=head1 DESCRIPTION

Provides information about migrating a bot from Amazon Lex V1 to Amazon
Lex V2.

=head1 ATTRIBUTES


=head2 MigrationId => Str

The unique identifier that Amazon Lex assigned to the migration.


=head2 MigrationStatus => Str

The status of the operation. When the status is C<COMPLETE> the bot is
available in Amazon Lex V2. There may be alerts and warnings that need
to be resolved to complete the migration.


=head2 MigrationStrategy => Str

The strategy used to conduct the migration.


=head2 MigrationTimestamp => Str

The date and time that the migration started.


=head2 V1BotLocale => Str

The locale of the Amazon Lex V1 bot that is the source of the
migration.


=head2 V1BotName => Str

The name of the Amazon Lex V1 bot that is the source of the migration.


=head2 V1BotVersion => Str

The version of the Amazon Lex V1 bot that is the source of the
migration.


=head2 V2BotId => Str

The unique identifier of the Amazon Lex V2 that is the destination of
the migration.


=head2 V2BotRole => Str

The IAM role that Amazon Lex uses to run the Amazon Lex V2 bot.



